import React, { Component } from "react";
import { Route,NavLink } from "react-router-dom";
import Airtable from "airtable";

const base = new Airtable({ apiKey: "keyHHrGcNLiewGh05" }).base(
  "appnnQqeeXZmvVJvB"
);

export default class Employees extends Component {
  constructor(props) {
    super(props);
    this.state = { employees: [] };
  }
  componentDidMount() {
    // let a = "Tushar Bansal";
    //let name = `'${a}'`;
    base("Imported table")
      .select({
        view: "Grid view",
        //filterByFormula: "SEARCH(" + name + ",{Participant Name})",
        fields: ["Date", "Participant Name"],
      })
      .eachPage((records, fetchNextPage) => {
        let arr = records.map((record) => record.fields["Participant Name"]);
        let a = new Set(arr);
        this.setState({ employees: a });
        fetchNextPage();
      });
  }
  render() {
      console.log(this.state.employees)
    return (
        <>
         {this.state.employees.map((value) => (
            <div className="link">
              <NavLink to={value}>
                {value}
              </NavLink>
        </div>))}
      </>
    );
  }
}
